import React from 'react';
import './App.css';
import { NavLink } from 'react-router-dom';



const Home = () => {
return (
    <div className="home">
        <h1> Welcome to the Chat Room! </h1>
        <NavLink className="webchat" exact to='/chatroom'>
            <button class>
            Chat Room
            </button>

        </NavLink>               

    </div>
);
}

export default Home;
